import React from "react";

import styles from "./ProjectItem.module.scss";

const ProjectItem = ({ heroImage, title, role, challenges, technos }) => {
  return (
    <div>
      <div>
        <img
          src={heroImage}
          style={{ width: "100%", height: "400px", objectFit: "cover" }}
        />
        <h1>{title}</h1>
      </div>
      <div>
        <div>
          <div>
            Role :<p>{role}</p>
          </div>
          <div>
            Challenges
            <p>{challenges}</p>
          </div>
        </div>
        <div>
          <div>
            Technos :<p>{technos}</p>
          </div>
          <div>Link to the website</div>
        </div>
      </div>
      <div>Images</div>
      <div>Previous Project / next Project</div>
    </div>
  );
};

export default ProjectItem;
